import { loadPath, LOGIN_PAGE_PATH, CONFIRM_PAGE_PATH, QUESTIONS_PAGE_PATH, SUBMIT_PAGE_PATH, WAIT_PAGE_PATH } from './store';
import { useEffect } from 'react';
import ExamTimer from './Components/ExamTimer';

