  }

  return (
    <div>
      <header className="App-header centereForm">
        <h1>Interview Hub</h1>
        {user.id != 0 && user.startedExam ? <ExamTimer handleTimeOver={handleTimeOver}></ExamTimer> : <></>}
      </header>

      <div>
        <Route path={LOGIN_PAGE_PATH}>
          <ApplicantLogin/></Route>
        <Route path={CONFIRM_PAGE_PATH}>
          <ConfirmExam/></Route>
        <Route path={QUESTIONS_PAGE_PATH}>
          <QuestionsExam/></Route>
        <Route path={SUBMIT_PAGE_PATH}>
          <SubmitExam/>
        </Route>
        <Route path={WAIT_PAGE_PATH}>
          <AwaitExamResults/>
        </Route>
      </div>
    </div> 
  );
}

export default App;
